    {'quote': "I fell in love with these kids. And I didn't want to see them fall victim to the system. So I made 'em a promise. I told them if they graduated from high school, I would pay for their college education. I have made some empty promises in my life but, hands down that was the most generous.", 'first_name': 'Michael', 'last_name': 'Scott', 'show': 'The Office', 'season': 6, 'episode': " Scott's Tots"},
