    {'quote': "Come on, flip the pickle, Morty. You're not gonna regret it. The payoff is huge. I turned myself into a pickle, Morty! Boom! Big reveal! I'm a pickle! What do you think about that? I turned myself into a pickle! W-what are you just staring at me for, bro? I turned myself into a pickle, Morty.", 'first_name': 'Rick', 'last_name': 'Sanchez', 'show': 'Rick and Morty', 'season': 3, 'episode': 'Pickle Rick'},
