    {'quote': "An-and I-I-I'll go out and I'll find some more of that Mulan Szechuan teriyaki dipping sauce, Morty! Th-b-because that's what this is all about, Morty! Th-that's my one-armed man! I'm not driven by avenging my dead family, Morty, that was fake! I-I-I'm driven by finding that McNugget sauce! I want that Mulan McNugget sauce, Morty! That's my series arc, Morty! If it takes nine seasons, I want my McNugget... dipping sauce Szechuan sauce, Morty! That's what's gon-it's gonna take us all the way to the end, Morty!", 'first_name': 'Rick', 'last_name': 'Sanchez', 'show': 'Rick and Morty', 'season': 3, 'episode': 'The Rickshank Redemption'},
    {'quote': "Because I don't respect therapy. Because I'm a scientist. Because I invent, transform, create, and destroy for a living, and when I don't like something about the world, I change it. And I don't think going to a rented office in a strip mall to listen to some agent of averageness explain which words mean which feelings has ever helped anyone do anything. I think it's helped a lot of people get comfortable and stop panicking, which is a state of mind we value in the animals we eat, but not something I want for myself. I'm not a cow. I'm a pickle. When I feel like it. So... you asked.", 'first_name': 'Rick', 'last_name': 'Sanchez', 'show': 'Rick and Morty', 'season': 3, 'episode': 'Pickle Rick'},
    {'quote': "'I took your family'? Who do you think had taken more from them when you shot 20 CCs of liquid dreamkiller into my daughter? She was Rick's daughter, Jerry! She had options! That all ended because she felt sorry for you. You act like prey, but you're a predator! You use pity to lure in your victims! That's how you survive! I survive cause I know everything, that snake survives because children wander off, and you survive 'cause people think 'Ooh, this poor piece of shit, he never gets a break! I can't stand the deafening silent wails of his wilting soul! I guess I'll hire him or marry him!'", 'first_name': 'Rick', 'last_name': 'Sanchez', 'show': 'Rick and Morty', 'season': 3, 'episode': 'The Whirly Dirly Conspiracy'},
    {'quote': "We're the only fehh-friends we got, Morty! It's just Rick and Morty! Ruh-ick and Morty and their adventures, Morty! Rick and Morty forever and forever, 100 years, Rick and Morty's things! Me and Rick and Morty running around and... Rick and Morty time! All day long, forever... all- a hundred days! Rick and Morty forever a hundred times!", 'first_name': 'Rick', 'last_name': 'Sanchez', 'show': 'Rick and Morty', 'season': 1, 'episode': 'Pilot'},
    {'quote': "Morty, sit here. Summer, you sit here. Now, listen—I know the two of you are very different from each other in a lot of ways, but you have to understand that as far as Grandpa's concerned, you're both pieces of shit! Yeah. I can prove it mathematically. Actually, l-l-let me grab my whiteboard. This has been a long time coming, anyways.", 'first_name': 'Rick', 'last_name': 'Sanchez', 'show': 'Rick and Morty', 'season': 2, 'episode': 'A Rickle in Time'},
